$BODY$
DECLARE notif_id INTEGER;
BEGIN
		VALUES ('User Followed', NEW.followed_id)
		RETURNING id INTO notif_id;

		VALUES (notif_id, NEW.follower_id);

	RETURN NEW;
END
$BODY$
LANGUAGE plpgsql;

DROP TRIGGER IF EXISTS user_followed_notification on follow CASCADE;
