	VALUES (144, 138, TIMESTAMP WITH TIME ZONE '2018-03-28 10:04:15+00', 'Mas queimar-lhe-á lugares, templos, casas;
');
	VALUES (144, 217, TIMESTAMP WITH TIME ZONE '2018-03-28 17:00:10+00', 'Que já ouviu dizer, que noutra terra
');

	VALUES (145, 139, TIMESTAMP WITH TIME ZONE '2020-01-13 10:33:29+00', 'Entre as Boreais neves se recreia,
');
	VALUES (145, 219, TIMESTAMP WITH TIME ZONE '2020-01-13 14:38:10+00', 'Que os filhos que no ninho sós estão,
');
	VALUES (145, 139, TIMESTAMP WITH TIME ZONE '2020-01-13 16:49:24+00', 'Que causa inda será de larga história,
');

	VALUES (146, 222, TIMESTAMP WITH TIME ZONE '2019-12-01 03:49:55+00', 'Idade d''ouro, tanto te privou,
');
	VALUES (146, 222, TIMESTAMP WITH TIME ZONE '2019-12-01 04:34:12+00', 'Consigo os elementos terem guerra.
');
	VALUES (146, 139, TIMESTAMP WITH TIME ZONE '2019-12-01 05:46:51+00', 'Pela grandeza feia de meu gesto,
');
	VALUES (146, 139, TIMESTAMP WITH TIME ZONE '2019-12-01 08:07:41+00', 'Cairão facilmente na cilada.
');

	VALUES (147, 143, TIMESTAMP WITH TIME ZONE '2020-11-16 01:22:01+00', 'Nós temos a Lei certa, que ensinou
');
	VALUES (147, 177, TIMESTAMP WITH TIME ZONE '2020-11-16 06:45:09+00', 'Já parece bem feito que lhe seja
');
	VALUES (147, 177, TIMESTAMP WITH TIME ZONE '2020-11-16 13:42:04+00', 'Quem pode ser que tanto vos abrande
');
	VALUES (147, 177, TIMESTAMP WITH TIME ZONE '2020-11-16 16:43:10+00', '"Ali o poder de muitos inimigos
');

	VALUES (148, 143, TIMESTAMP WITH TIME ZONE '2020-12-29 13:22:10+00', 'Tal há de ser quem quer, com o dom de Marte,
');
	VALUES (148, 143, TIMESTAMP WITH TIME ZONE '2020-12-29 15:17:59+00', 'E mar tranquilo, pera a pátria amada."
');

	VALUES (149, 177, TIMESTAMP WITH TIME ZONE '2019-11-10 19:37:19+00', 'Lágrimas são de míseros amantes;
');
	VALUES (149, 145, TIMESTAMP WITH TIME ZONE '2019-11-10 21:08:09+00', '"Goa vereis aos Mouros ser tomada,
');
	VALUES (149, 177, TIMESTAMP WITH TIME ZONE '2019-11-11 03:51:36+00', 'E, porque tanto imitam as antigas
');

	VALUES (150, 145, TIMESTAMP WITH TIME ZONE '2019-11-17 04:59:32+00', 'Coisas do mar, que os homens não entendem:
');
	VALUES (150, 168, TIMESTAMP WITH TIME ZONE '2019-11-17 09:45:27+00', 'De uma árvore de Cristo mais amada
');
	VALUES (150, 168, TIMESTAMP WITH TIME ZONE '2019-11-17 10:42:01+00', 'O preso amigo, preso por leal:
');
	VALUES (150, 168, TIMESTAMP WITH TIME ZONE '2019-11-17 12:32:36+00', 'Sabendo ser sequazes da verdade,
');

	VALUES (151, 200, TIMESTAMP WITH TIME ZONE '2021-03-26 14:09:04+00', 'Descer enfim às sombras vãs e escuras
');

	VALUES (152, 148, TIMESTAMP WITH TIME ZONE '2021-02-14 17:56:11+00', 'Que esta perna trouxe eu dali ferida;
');
	VALUES (152, 221, TIMESTAMP WITH TIME ZONE '2021-02-14 23:10:49+00', 'E Judeia, que um Deus adora e ama,
');
	VALUES (152, 148, TIMESTAMP WITH TIME ZONE '2021-02-15 06:03:12+00', 'Outros, por outra parte, vão topar
');
	VALUES (152, 148, TIMESTAMP WITH TIME ZONE '2021-02-15 08:11:49+00', 'Dos seus, correndo acode à primeira ala:
');

	VALUES (153, 215, TIMESTAMP WITH TIME ZONE '2021-02-15 11:13:13+00', 'Bem no filho de Alcmena se parece,
');

	VALUES (154, 198, TIMESTAMP WITH TIME ZONE '2021-02-09 07:09:34+00', '"Destes Anrique, dizem que segundo
');

	VALUES (155, 153, TIMESTAMP WITH TIME ZONE '2020-10-01 01:23:04+00', 'Debaixo dalgum nome preminente?
');

	VALUES (156, 153, TIMESTAMP WITH TIME ZONE '2018-12-25 17:03:25+00', 'Cada uma escreve ao seu por vários modos,
');
	VALUES (156, 153, TIMESTAMP WITH TIME ZONE '2018-12-25 23:09:01+00', 'Poder ninguém vencer o Rei terríbil.
');
	VALUES (156, 276, TIMESTAMP WITH TIME ZONE '2018-12-26 05:36:32+00', 'Dos ódios concebidos não remoto
');
	VALUES (156, 153, TIMESTAMP WITH TIME ZONE '2018-12-26 12:43:49+00', 'Verás as várias partes, que os insanos
');

	VALUES (157, 266, TIMESTAMP WITH TIME ZONE '2021-01-09 05:29:58+00', 'Como se longa fora já a amizade,
');
	VALUES (157, 266, TIMESTAMP WITH TIME ZONE '2021-01-09 06:55:59+00', 'Tomando-nos cidades e altos muros.
');
	VALUES (157, 154, TIMESTAMP WITH TIME ZONE '2021-01-09 07:29:00+00', 'E aquela certa ajuda em ti esperamos,
');
	VALUES (157, 154, TIMESTAMP WITH TIME ZONE '2021-01-09 14:25:13+00', 'Senão com algum conto de alegria,
');

	VALUES (158, 272, TIMESTAMP WITH TIME ZONE '2020-05-12 09:18:23+00', 'Trazendo-nos galinhas e carneiros,
');
	VALUES (158, 157, TIMESTAMP WITH TIME ZONE '2020-05-12 12:54:52+00', 'Uma na paz angélica dourada,
');

	VALUES (159, 157, TIMESTAMP WITH TIME ZONE '2020-09-10 14:33:43+00', 'Boa injúria do grande Constantino!
');
	VALUES (159, 174, TIMESTAMP WITH TIME ZONE '2020-09-10 18:36:01+00', 'De quem ninguém se exime dos humanos,
');

	VALUES (160, 158, TIMESTAMP WITH TIME ZONE '2021-05-01 19:21:42+00', 'Neste caso não quis que falecesse;
');
	VALUES (160, 158, TIMESTAMP WITH TIME ZONE '2021-05-02 02:38:45+00', 'Dos marinheiros, de uma e de outra banda;
');
	VALUES (160, 242, TIMESTAMP WITH TIME ZONE '2021-05-02 03:01:12+00', 'As mãos alvas lhes davam como esposas;
');
	VALUES (160, 158, TIMESTAMP WITH TIME ZONE '2021-05-02 03:51:20+00', '"Olha Dófar, insigne porque manda
');

	VALUES (161, 217, TIMESTAMP WITH TIME ZONE '2019-01-03 18:48:38+00', 'Três dias o grão Rei no campo fiei.
');
	VALUES (161, 217, TIMESTAMP WITH TIME ZONE '2019-01-03 19:12:45+00', 'Ali com o amor intrínseco e vontade
');
	VALUES (161, 163, TIMESTAMP WITH TIME ZONE '2019-01-03 20:41:29+00', 'E junto donde nasce o largo braço
');
	VALUES (161, 217, TIMESTAMP WITH TIME ZONE '2019-01-03 22:41:16+00', 'Consigo os elementos terem guerra.
');

	VALUES (162, 205, TIMESTAMP WITH TIME ZONE '2021-05-12 19:46:00+00', 'Contra quem as tirou; que Deus peleja
');
	VALUES (162, 205, TIMESTAMP WITH TIME ZONE '2021-05-13 00:26:44+00', '"Pões-te da parte da desdita minha?
');
	VALUES (162, 164, TIMESTAMP WITH TIME ZONE '2021-05-13 04:40:23+00', 'Dos marinheiros, de uma e de outra banda;
');

	VALUES (163, 164, TIMESTAMP WITH TIME ZONE '2021-06-02 12:46:33+00', 'Posto que em todo o mundo, de afrontados,
');
	VALUES (163, 164, TIMESTAMP WITH TIME ZONE '2021-06-02 13:40:42+00', 'Não sabem nesta pressa quem lhe valha;
');

	VALUES (164, 263, TIMESTAMP WITH TIME ZONE '2021-04-09 13:08:34+00', 'Descobri-la-á a primeira vossa frota.
');
	VALUES (164, 263, TIMESTAMP WITH TIME ZONE '2021-04-09 14:21:07+00', 'Doutra Cila e Caríbdis já passados,
');
	VALUES (164, 263, TIMESTAMP WITH TIME ZONE '2021-04-09 16:20:17+00', 'Faz escudo às galés, diante posto.
');
	VALUES (164, 165, TIMESTAMP WITH TIME ZONE '2021-04-09 21:52:34+00', 'A qual Coulão, a qual dá Cranganor,
');

	VALUES (165, 165, TIMESTAMP WITH TIME ZONE '2021-03-10 19:05:59+00', 'Pode tanto em Tarpeia avaro vício,
');
	VALUES (165, 250, TIMESTAMP WITH TIME ZONE '2021-03-11 00:31:10+00', 'Foi convertido em peixe, e deste dano
');
	VALUES (165, 250, TIMESTAMP WITH TIME ZONE '2021-03-11 03:44:52+00', 'De um bordo e doutro súbito saltavam,
');
	VALUES (165, 165, TIMESTAMP WITH TIME ZONE '2021-03-11 09:06:54+00', 'Para servir a seu desejo feio,
');

	VALUES (166, 166, TIMESTAMP WITH TIME ZONE '2020-11-12 14:22:36+00', 'Relâmpagos ao mundo fulminantes,
');

	VALUES (167, 204, TIMESTAMP WITH TIME ZONE '2020-11-23 01:12:40+00', 'Grande parte do mundo está guardada,
');
	VALUES (167, 166, TIMESTAMP WITH TIME ZONE '2020-11-23 07:43:11+00', 'Os traquetes das gáveas tomar manda:
');
	VALUES (167, 166, TIMESTAMP WITH TIME ZONE '2020-11-23 10:43:10+00', 'É Japão, onde nace a prata fina,
');
	VALUES (167, 204, TIMESTAMP WITH TIME ZONE '2020-11-23 12:47:18+00', 'Adúltera inclinava os animais
');

	VALUES (168, 265, TIMESTAMP WITH TIME ZONE '2019-11-11 18:00:44+00', 'Mais o público bem que o seu respeita.
');
	VALUES (168, 169, TIMESTAMP WITH TIME ZONE '2019-11-12 01:48:54+00', 'Tanto como qualquer Romano antigo.
');
	VALUES (168, 169, TIMESTAMP WITH TIME ZONE '2019-11-12 01:58:52+00', 'Outro novo Cupido se gerara.
');

	VALUES (169, 212, TIMESTAMP WITH TIME ZONE '2020-04-10 09:43:35+00', '"E se, agravadas damas, sois servidas,
');

	VALUES (170, 170, TIMESTAMP WITH TIME ZONE '2020-06-23 19:18:27+00', 'Avante passa, e lá no sexto Céu,
');

	VALUES (171, 271, TIMESTAMP WITH TIME ZONE '2021-04-05 12:19:58+00', 'O Conde Bolonhês, depois alçado
');
	VALUES (171, 271, TIMESTAMP WITH TIME ZONE '2021-04-05 16:55:11+00', 'De Arábia e Pérsias terras abundantes.
');

	VALUES (172, 172, TIMESTAMP WITH TIME ZONE '2018-04-27 22:35:44+00', 'Para que tu recíproco respondas,
');
	VALUES (172, 172, TIMESTAMP WITH TIME ZONE '2018-04-28 03:25:32+00', 'Sustenta só coa vista veneranda,
');
	VALUES (172, 243, TIMESTAMP WITH TIME ZONE '2018-04-28 05:46:09+00', 'A quem juízo algum nunca alcançou!
');
	VALUES (172, 243, TIMESTAMP WITH TIME ZONE '2018-04-28 06:47:37+00', 'Por sinais muito claros se mostrou,
');

	VALUES (173, 190, TIMESTAMP WITH TIME ZONE '2021-04-14 04:54:17+00', 'Esse outro que esclarece toda Ausónía,
');
	VALUES (173, 173, TIMESTAMP WITH TIME ZONE '2021-04-14 05:18:29+00', 'A tento nela os olhos apascenta.
');

	VALUES (174, 185, TIMESTAMP WITH TIME ZONE '2020-06-14 01:03:12+00', 'Com ela ficam Álvaro e Diogo,
');
	VALUES (174, 173, TIMESTAMP WITH TIME ZONE '2020-06-14 08:27:29+00', 'Que do Séquana e Ródano é regada,
');
	VALUES (174, 173, TIMESTAMP WITH TIME ZONE '2020-06-14 09:26:54+00', 'Possam dizer que são pera mandados,
');

	VALUES (175, 209, TIMESTAMP WITH TIME ZONE '2020-04-13 06:05:05+00', 'De novo, mais que nunca, derribado;
');
	VALUES (175, 176, TIMESTAMP WITH TIME ZONE '2020-04-13 13:25:29+00', 'Tratar branduras em tanta aspereza;
');
	VALUES (175, 209, TIMESTAMP WITH TIME ZONE '2020-04-13 14:05:37+00', '(Vede da natureza o desconcerto!)
');
	VALUES (175, 176, TIMESTAMP WITH TIME ZONE '2020-04-13 16:58:11+00', 'Já que à bruta crueza e feridade
');

	VALUES (176, 177, TIMESTAMP WITH TIME ZONE '2018-10-23 23:43:25+00', 'Por se dar cara ao triste que a seguia,
');
	VALUES (176, 177, TIMESTAMP WITH TIME ZONE '2018-10-24 04:44:19+00', 'Não é ele por armas esforçado,
');

	VALUES (177, 177, TIMESTAMP WITH TIME ZONE '2020-03-18 00:16:37+00', 'As telas douro fino, e que o cantassem.
');
	VALUES (177, 177, TIMESTAMP WITH TIME ZONE '2020-03-18 05:35:37+00', '"Desta sorte o Judaico povo antigo
');
	VALUES (177, 238, TIMESTAMP WITH TIME ZONE '2020-03-18 10:51:43+00', 'Tal manha buscou já, para que aquele
');

	VALUES (178, 178, TIMESTAMP WITH TIME ZONE '2021-04-12 00:15:38+00', '"Tão grande era de membros, que bem posso
');
	VALUES (178, 190, TIMESTAMP WITH TIME ZONE '2021-04-12 06:55:08+00', 'Da branca Tétis única despida:
');

	VALUES (179, 182, TIMESTAMP WITH TIME ZONE '2019-09-15 11:55:19+00', 'Do descuido remisso de Fernando,
');

	VALUES (180, 182, TIMESTAMP WITH TIME ZONE '2021-02-24 22:41:06+00', 'Sem dar reposta, prontos e contentes.
');
	VALUES (180, 182, TIMESTAMP WITH TIME ZONE '2021-02-25 05:16:34+00', 'Por estas longas águas se estenderam;
');

	VALUES (181, 183, TIMESTAMP WITH TIME ZONE '2020-08-05 13:23:42+00', 'Entre as rosas e a neve humana pura,
');
	VALUES (181, 277, TIMESTAMP WITH TIME ZONE '2020-08-05 19:07:04+00', 'Cantem, louvem e escrevam sempre extremos
');
	VALUES (181, 277, TIMESTAMP WITH TIME ZONE '2020-08-05 21:17:42+00', 'Estas palavras tais, chorando, espalha:
');
	VALUES (181, 277, TIMESTAMP WITH TIME ZONE '2020-08-05 23:26:11+00', 'Pesando-lhe do pouco que lhe pede.
');

	VALUES (182, 184, TIMESTAMP WITH TIME ZONE '2020-08-29 03:48:45+00', 'Dos vagarosos bois, ali sentadas,
');
	VALUES (182, 231, TIMESTAMP WITH TIME ZONE '2020-08-29 11:43:56+00', 'Foram sempre conosco aventureiros.
');
	VALUES (182, 184, TIMESTAMP WITH TIME ZONE '2020-08-29 18:14:44+00', '"Olha o muro e edifício nunca crido,
');
	VALUES (182, 184, TIMESTAMP WITH TIME ZONE '2020-08-29 22:30:26+00', 'Assopra-lhe galerno o vento, e brando,
');

	VALUES (183, 186, TIMESTAMP WITH TIME ZONE '2018-12-06 19:58:24+00', 'Fazem que não lha comprem mercadores;
');

	VALUES (184, 186, TIMESTAMP WITH TIME ZONE '2019-09-16 15:28:28+00', 'A Briareu parece que imitava;
');
	VALUES (184, 186, TIMESTAMP WITH TIME ZONE '2019-09-16 18:34:19+00', 'Assim dizendo, os ventos que lutavam
');

	VALUES (185, 187, TIMESTAMP WITH TIME ZONE '2019-10-09 12:36:46+00', 'Dos altos feitos grandes e subidos.
');

	VALUES (186, 246, TIMESTAMP WITH TIME ZONE '2020-11-23 19:36:03+00', 'Pelas concavidades retumbando.
');
	VALUES (186, 246, TIMESTAMP WITH TIME ZONE '2020-11-23 19:55:28+00', 'Não nos apanhasse a água da enseada,
');
	VALUES (186, 246, TIMESTAMP WITH TIME ZONE '2020-11-23 20:42:32+00', 'No reino os inimigos, não se atrevem
');

	VALUES (187, 219, TIMESTAMP WITH TIME ZONE '2019-11-05 04:23:00+00', 'Olha as portas do Estreito, que fenece
');
	VALUES (187, 219, TIMESTAMP WITH TIME ZONE '2019-11-05 04:53:57+00', 'Que já naquele tempo as mais Guerreiras
');
	VALUES (187, 219, TIMESTAMP WITH TIME ZONE '2019-11-05 11:53:16+00', 'Onde imaginações mais certas são?
');

	VALUES (188, 188, TIMESTAMP WITH TIME ZONE '2019-07-18 14:43:15+00', 'Como quem em mui grande estima tinha
');

	VALUES (189, 242, TIMESTAMP WITH TIME ZONE '2021-04-12 09:28:19+00', 'Sôbolo tanque lúcido e sereno;
');

	VALUES (190, 191, TIMESTAMP WITH TIME ZONE '2019-07-18 11:29:26+00', 'E sabe mais, lhe diz, como entendido
');
	VALUES (190, 191, TIMESTAMP WITH TIME ZONE '2019-07-18 17:41:15+00', 'Quando um e outro corno lhe aquentava,
');

	VALUES (191, 244, TIMESTAMP WITH TIME ZONE '2019-06-20 00:46:56+00', '"Eis aqui, quase cume da cabeça
');
	VALUES (191, 244, TIMESTAMP WITH TIME ZONE '2019-06-20 05:51:04+00', '"Se os antigos filósofos, que andaram
');
	VALUES (191, 244, TIMESTAMP WITH TIME ZONE '2019-06-20 12:26:28+00', 'Que depois em Suez se converteu,
');

	VALUES (192, 231, TIMESTAMP WITH TIME ZONE '2020-06-29 06:03:26+00', 'Da Índia, Pérsia, Arábia e de Etiópia?
');
	VALUES (192, 192, TIMESTAMP WITH TIME ZONE '2020-06-29 06:45:31+00', 'Lhe diz, que a mais da gente em Cristo cria.
');

	VALUES (193, 257, TIMESTAMP WITH TIME ZONE '2020-05-17 11:25:20+00', 'Lá no novo Hemisfério, nova estrela,
');
	VALUES (193, 192, TIMESTAMP WITH TIME ZONE '2020-05-17 18:59:31+00', 'Júpiter, Juno, fomos fabulosos,
');
	VALUES (193, 192, TIMESTAMP WITH TIME ZONE '2020-05-17 21:38:25+00', '"Da terra dos Algarves, que lhe fora
');
	VALUES (193, 257, TIMESTAMP WITH TIME ZONE '2020-05-17 23:13:40+00', 'E de toldos alegres se adornou,
');

	VALUES (194, 195, TIMESTAMP WITH TIME ZONE '2018-08-06 16:41:34+00', 'Que eu tanto tempo há já que guardo e tenho,
');
	VALUES (194, 261, TIMESTAMP WITH TIME ZONE '2018-08-06 23:05:27+00', 'Aqui porá da Turca armada dura
');
	VALUES (194, 261, TIMESTAMP WITH TIME ZONE '2018-08-07 04:23:23+00', 'Porém tanto o tumulto se moveu
');

	VALUES (195, 195, TIMESTAMP WITH TIME ZONE '2020-12-28 15:52:55+00', 'Já sobre os Idálios montes pende,
');
	VALUES (195, 195, TIMESTAMP WITH TIME ZONE '2020-12-28 16:33:47+00', 'Que em si escondem os régios aposentos,
');
	VALUES (195, 246, TIMESTAMP WITH TIME ZONE '2020-12-28 17:06:06+00', 'E mais quando os que Beja em vão cercaram,
');

	VALUES (196, 241, TIMESTAMP WITH TIME ZONE '2019-12-23 22:39:04+00', 'E com grandes palavras lhe oferece
');
	VALUES (196, 197, TIMESTAMP WITH TIME ZONE '2019-12-23 23:50:33+00', 'De África toda, gente fera e estranha,
');
	VALUES (196, 241, TIMESTAMP WITH TIME ZONE '2019-12-24 04:20:43+00', 'Louvor alheio muito o esperta e incita.
');

	VALUES (197, 197, TIMESTAMP WITH TIME ZONE '2020-02-04 20:13:48+00', 'Dizia, eis aqui venho oferecido
');
	VALUES (197, 237, TIMESTAMP WITH TIME ZONE '2020-02-05 03:02:08+00', '"Esta luz é do fogo e das luzentes
');
	VALUES (197, 237, TIMESTAMP WITH TIME ZONE '2020-02-05 06:32:38+00', 'Os Portugueses, sempre apercebidos.
');

	VALUES (198, 198, TIMESTAMP WITH TIME ZONE '2020-04-21 07:44:43+00', 'Várias gentes, e leis, e várias manhas.
');

	VALUES (199, 237, TIMESTAMP WITH TIME ZONE '2019-09-06 16:50:43+00', 'Fossem, humanamente nos trataram,
');
	VALUES (199, 237, TIMESTAMP WITH TIME ZONE '2019-09-06 23:15:13+00', 'Por alta influição do imóvel fado,
');

	VALUES (200, 199, TIMESTAMP WITH TIME ZONE '2019-10-28 12:12:43+00', 'A Reinos tão remotos e apartados.
');

	VALUES (201, 200, TIMESTAMP WITH TIME ZONE '2021-04-07 16:57:04+00', 'Mas não passes os três que em França e Espanha
');
	VALUES (201, 203, TIMESTAMP WITH TIME ZONE '2021-04-07 23:38:31+00', 'Contra uma dama, ó peitos carniceiros,
');
	VALUES (201, 200, TIMESTAMP WITH TIME ZONE '2021-04-08 00:11:13+00', 'Quantos montes, então, que derribaram
');

	VALUES (202, 200, TIMESTAMP WITH TIME ZONE '2021-03-30 05:15:26+00', 'A pedra, o pau, e o canto arremessando;
');
	VALUES (202, 200, TIMESTAMP WITH TIME ZONE '2021-03-30 06:42:37+00', 'Não vos hão-de faltar, gente famosa,
');
	VALUES (202, 200, TIMESTAMP WITH TIME ZONE '2021-03-30 12:46:59+00', 'Das razões em contrário que acharias
');
	VALUES (202, 200, TIMESTAMP WITH TIME ZONE '2021-03-30 20:08:41+00', 'Mas não deixes no mar as Ilhas onde
');

	VALUES (203, 273, TIMESTAMP WITH TIME ZONE '2020-07-17 11:45:49+00', 'Que com gente melhor comunicavam;
');
	VALUES (203, 273, TIMESTAMP WITH TIME ZONE '2020-07-17 19:19:56+00', 'Corpo certo me tem maravilhado.--
');
	VALUES (203, 201, TIMESTAMP WITH TIME ZONE '2020-07-17 21:27:25+00', 'Como vereis o mar fervendo aceso
');

	VALUES (204, 222, TIMESTAMP WITH TIME ZONE '2018-12-02 02:42:27+00', 'Estará pronto a toda adversidade,
');
	VALUES (204, 222, TIMESTAMP WITH TIME ZONE '2018-12-02 03:54:55+00', 'Senão direi que tens algum receio,
');
	VALUES (204, 222, TIMESTAMP WITH TIME ZONE '2018-12-02 11:07:26+00', 'Com súbito temor e desacordo,
');
	VALUES (204, 222, TIMESTAMP WITH TIME ZONE '2018-12-02 18:18:03+00', 'E onde Febo repousa no Oceano.
');

	VALUES (205, 204, TIMESTAMP WITH TIME ZONE '2019-09-14 19:59:13+00', 'Que o corpo cristalino deixa ver-se,
');
	VALUES (205, 235, TIMESTAMP WITH TIME ZONE '2019-09-15 02:00:13+00', 'Para o Prasso sabido se moveu.
');
	VALUES (205, 204, TIMESTAMP WITH TIME ZONE '2019-09-15 04:36:16+00', 'Primeiro tratarei da larga terra,
');

	VALUES (206, 204, TIMESTAMP WITH TIME ZONE '2018-12-23 14:30:33+00', 'E não a mim, que creio o que podeis!"
');

	VALUES (207, 260, TIMESTAMP WITH TIME ZONE '2019-07-01 08:41:20+00', 'Daqui e dali saltando, o charco soa,
');

	VALUES (208, 254, TIMESTAMP WITH TIME ZONE '2019-07-18 15:45:04+00', 'Que contra tua potência se rebela,
');
	VALUES (208, 209, TIMESTAMP WITH TIME ZONE '2019-07-18 23:03:45+00', 'Conquanto teve o mestre tanto tento,
');
	VALUES (208, 254, TIMESTAMP WITH TIME ZONE '2019-07-19 05:18:28+00', 'Nas mostras e no gesto o não mostrou;
');
	VALUES (208, 254, TIMESTAMP WITH TIME ZONE '2019-07-19 10:29:44+00', 'Certíssimo sinal, e conhecido,
');

	VALUES (209, 210, TIMESTAMP WITH TIME ZONE '2020-10-09 23:13:55+00', 'As inquietas ondas apartando;
');
	VALUES (209, 275, TIMESTAMP WITH TIME ZONE '2020-10-10 06:04:19+00', 'E a maneira do trajo diferente.
');
	VALUES (209, 275, TIMESTAMP WITH TIME ZONE '2020-10-10 12:25:39+00', 'Sujeitando Parténope inquieta;
');
	VALUES (209, 275, TIMESTAMP WITH TIME ZONE '2020-10-10 15:34:34+00', 'Dos ódios concebidos não remoto
');

	VALUES (210, 214, TIMESTAMP WITH TIME ZONE '2021-02-05 00:27:12+00', 'A tomou dos fugidos homicidas.
');
	VALUES (210, 214, TIMESTAMP WITH TIME ZONE '2021-02-05 06:28:33+00', 'Nem eu consentirei que a excelência
');
	VALUES (210, 214, TIMESTAMP WITH TIME ZONE '2021-02-05 11:26:46+00', 'Que um ergue Dio, outro o defende erguido.
');
	VALUES (210, 214, TIMESTAMP WITH TIME ZONE '2021-02-05 17:26:07+00', 'Que ambos, imigos das humanas vidas,
');

	VALUES (211, 214, TIMESTAMP WITH TIME ZONE '2020-05-30 01:12:39+00', 'Tornado carmesi de branco e verde.
');
	VALUES (211, 270, TIMESTAMP WITH TIME ZONE '2020-05-30 06:12:52+00', 'De consciência e de virtude interna
');

	VALUES (212, 216, TIMESTAMP WITH TIME ZONE '2020-04-11 08:55:55+00', 'Que não eram das rosas ou das flores,
');
	VALUES (212, 223, TIMESTAMP WITH TIME ZONE '2020-04-11 10:01:46+00', 'Que pelo Rei já tinham segurado:
');
	VALUES (212, 216, TIMESTAMP WITH TIME ZONE '2020-04-11 17:08:22+00', 'Três vezes a cabeça, descontente,
');

	VALUES (213, 218, TIMESTAMP WITH TIME ZONE '2019-12-24 15:43:57+00', 'Honra, valor e fama gloriosa."
');
	VALUES (213, 218, TIMESTAMP WITH TIME ZONE '2019-12-24 20:23:31+00', 'Trazia de delgada beatilha,
');
	VALUES (213, 226, TIMESTAMP WITH TIME ZONE '2019-12-25 03:37:18+00', 'Já lá da banda do Austro e do Oriente,
');
	VALUES (213, 226, TIMESTAMP WITH TIME ZONE '2019-12-25 08:14:12+00', 'Uma na paz angélica dourada,
');

	VALUES (214, 273, TIMESTAMP WITH TIME ZONE '2020-04-30 22:42:50+00', 'Já a companhia pérfida e nefanda
');
	VALUES (214, 273, TIMESTAMP WITH TIME ZONE '2020-05-01 03:01:43+00', 'Inimiga terão esta paragem
');
	VALUES (214, 219, TIMESTAMP WITH TIME ZONE '2020-05-01 04:57:41+00', 'Fogo que o mundo em armas acendeu
');
	VALUES (214, 219, TIMESTAMP WITH TIME ZONE '2020-05-01 07:29:09+00', 'Veloso, sem que alguém lhe ali ajudasse;
');

	VALUES (215, 221, TIMESTAMP WITH TIME ZONE '2019-05-15 04:23:23+00', 'E de vencidos já desesperados.
');

	VALUES (216, 264, TIMESTAMP WITH TIME ZONE '2019-10-08 23:19:58+00', 'Na praia com os batéis, como ordenara.
');
	VALUES (216, 221, TIMESTAMP WITH TIME ZONE '2019-10-09 01:39:45+00', 'E a vontade à dádiva excedia.
');

	VALUES (217, 277, TIMESTAMP WITH TIME ZONE '2019-03-08 21:41:39+00', 'Que, vedes, Vénus traz a medicina,
');

	VALUES (218, 233, TIMESTAMP WITH TIME ZONE '2021-03-08 10:15:09+00', '"E que se houver alguém, com lança e espada,
');
	VALUES (218, 233, TIMESTAMP WITH TIME ZONE '2021-03-08 15:41:28+00', 'Um venerando e próspero senhor;
');
	VALUES (218, 222, TIMESTAMP WITH TIME ZONE '2021-03-08 21:50:19+00', 'Do Malabar melhor, onde vivia
');
	VALUES (218, 222, TIMESTAMP WITH TIME ZONE '2021-03-08 23:11:51+00', 'Para estes Anibais nenhum Marcelo.
');

	VALUES (219, 225, TIMESTAMP WITH TIME ZONE '2019-07-08 13:41:25+00', 'Que tão disformemente ali lhe incharam
');
	VALUES (219, 262, TIMESTAMP WITH TIME ZONE '2019-07-08 21:04:38+00', 'Pelejar co invicto e forte Luso,
');

	VALUES (220, 230, TIMESTAMP WITH TIME ZONE '2020-10-05 10:12:01+00', 'Contra um bicho da terra tão pequeno?
');
	VALUES (220, 225, TIMESTAMP WITH TIME ZONE '2020-10-05 12:46:39+00', 'Aquele que depois a fez Rainha;
');
	VALUES (220, 230, TIMESTAMP WITH TIME ZONE '2020-10-05 16:05:00+00', 'Ramos não conhecidos e ervas tinha;
');

	VALUES (221, 243, TIMESTAMP WITH TIME ZONE '2020-02-02 02:07:37+00', 'Conheça, pelas armas, quanto excede
');

	VALUES (222, 228, TIMESTAMP WITH TIME ZONE '2019-12-28 06:43:17+00', 'Ajudada também da forte armada,
');

	VALUES (223, 261, TIMESTAMP WITH TIME ZONE '2019-05-31 20:57:04+00', 'A vender a pedraria que trouxeram.
');
	VALUES (223, 261, TIMESTAMP WITH TIME ZONE '2019-05-31 22:35:34+00', 'Convocados da parte do Tonante,
');
	VALUES (223, 231, TIMESTAMP WITH TIME ZONE '2019-05-31 23:58:40+00', 'Quando o tempo futuro especularam.
');
	VALUES (223, 261, TIMESTAMP WITH TIME ZONE '2019-06-01 01:50:46+00', 'Entre no reino d''água o Rei do vinho.
');

	VALUES (224, 231, TIMESTAMP WITH TIME ZONE '2019-09-04 08:23:11+00', 'Por hospícios alheios degradado;
');

	VALUES (225, 243, TIMESTAMP WITH TIME ZONE '2018-10-26 22:50:43+00', 'Alegres vinham todos, porque crêm
');
	VALUES (225, 232, TIMESTAMP WITH TIME ZONE '2018-10-27 04:52:24+00', '"Mas já o Planeta que no céu primeiro
');
	VALUES (225, 243, TIMESTAMP WITH TIME ZONE '2018-10-27 10:01:56+00', 'No fim de tantos casos trabalhosos,
');
	VALUES (225, 243, TIMESTAMP WITH TIME ZONE '2018-10-27 16:29:23+00', 'Lhe deu no mundo nomes tão estranhos
');

	VALUES (226, 232, TIMESTAMP WITH TIME ZONE '2018-09-30 08:22:21+00', 'Que querem dar aos seus libertadores
');
	VALUES (226, 254, TIMESTAMP WITH TIME ZONE '2018-09-30 12:48:15+00', 'Vendo Egas que ficava fementido,
');
	VALUES (226, 232, TIMESTAMP WITH TIME ZONE '2018-09-30 20:19:01+00', 'Para o rompido aluno mal sofrido,
');

	VALUES (227, 233, TIMESTAMP WITH TIME ZONE '2021-03-13 03:39:27+00', 'Ao longo da água que, suave e queda,
');
	VALUES (227, 236, TIMESTAMP WITH TIME ZONE '2021-03-13 06:06:13+00', 'Dom Sancho vai cercar em Santarém;
');
	VALUES (227, 233, TIMESTAMP WITH TIME ZONE '2021-03-13 10:54:54+00', 'Mandar ao Reino escuro de Cocito,
');
	VALUES (227, 236, TIMESTAMP WITH TIME ZONE '2021-03-13 14:29:51+00', 'Este causa os perjúrios entre a gente,
');

	VALUES (228, 233, TIMESTAMP WITH TIME ZONE '2021-04-25 04:30:02+00', 'Que ilustrada será co a Lei divina.
');

	VALUES (229, 262, TIMESTAMP WITH TIME ZONE '2019-07-30 05:36:08+00', 'Já a manhã clara dava nos outeiros
');
	VALUES (229, 262, TIMESTAMP WITH TIME ZONE '2019-07-30 07:46:35+00', 'Por que o tronco dos Reis se santifique."
');
	VALUES (229, 262, TIMESTAMP WITH TIME ZONE '2019-07-30 11:43:25+00', 'Sublime Rei, que não me atrevo a tanto,
');
	VALUES (229, 235, TIMESTAMP WITH TIME ZONE '2019-07-30 15:31:00+00', 'No Brasil, com vencer e castigar
');

	VALUES (230, 268, TIMESTAMP WITH TIME ZONE '2021-01-06 18:32:01+00', 'Que eu ouço retumbar a grão tormenta,
');

	VALUES (231, 273, TIMESTAMP WITH TIME ZONE '2020-04-08 16:05:23+00', 'Inimigos do antigo nome santo?
');
	VALUES (231, 273, TIMESTAMP WITH TIME ZONE '2020-04-08 19:27:43+00', 'Que, em tomando do Reino a governança,
');
	VALUES (231, 237, TIMESTAMP WITH TIME ZONE '2020-04-08 23:48:51+00', 'Por que pudessem ser aventurados
');
	VALUES (231, 273, TIMESTAMP WITH TIME ZONE '2020-04-09 05:51:19+00', 'Ornada de esmaltado e verde arreio;
');

	VALUES (232, 243, TIMESTAMP WITH TIME ZONE '2019-04-21 12:09:31+00', '"Contarei, disse, sem que me repreendam
');
	VALUES (232, 237, TIMESTAMP WITH TIME ZONE '2019-04-21 17:57:34+00', 'Que assi lho ensinou Cristo, e ele o prova.
');
	VALUES (232, 243, TIMESTAMP WITH TIME ZONE '2019-04-22 01:39:03+00', 'Que os vizinhos, da terra moradores,
');

	VALUES (233, 269, TIMESTAMP WITH TIME ZONE '2021-03-19 11:36:54+00', 'Que, no romper da vela, a nau pendente
');

	VALUES (234, 238, TIMESTAMP WITH TIME ZONE '2020-03-10 14:42:49+00', 'De que Nisa celebra inda a memória.
');
	VALUES (234, 238, TIMESTAMP WITH TIME ZONE '2020-03-10 19:31:31+00', 'Mas aqueles avaros Catuais,
');

	VALUES (235, 239, TIMESTAMP WITH TIME ZONE '2021-02-04 21:57:38+00', 'Pois contra o Castelhano tão temido,
');
	VALUES (235, 263, TIMESTAMP WITH TIME ZONE '2021-02-04 22:27:46+00', 'Gasalhado seguro te daria,
');

	VALUES (236, 254, TIMESTAMP WITH TIME ZONE '2021-02-14 21:45:51+00', '"Terra é de Calecu, se não me engano.
');

	VALUES (237, 241, TIMESTAMP WITH TIME ZONE '2019-02-02 21:05:03+00', 'Pelos sombrios matos e florestas
');

	VALUES (238, 266, TIMESTAMP WITH TIME ZONE '2018-11-21 10:22:38+00', 'Enverdecem as águas do Mondego,
');

	VALUES (239, 243, TIMESTAMP WITH TIME ZONE '2019-09-16 21:59:15+00', 'Que o povo forte tem de si inimigo:
');

	VALUES (240, 243, TIMESTAMP WITH TIME ZONE '2018-11-04 05:43:04+00', 'Olhando o ajuntamento Lusitano
');

	VALUES (241, 270, TIMESTAMP WITH TIME ZONE '2021-01-09 20:54:42+00', 'Mais do que fez a gente alta de Roma;
');
	VALUES (241, 270, TIMESTAMP WITH TIME ZONE '2021-01-09 21:22:07+00', 'Os balanços que os mares temerosos
');
	VALUES (241, 270, TIMESTAMP WITH TIME ZONE '2021-01-10 02:43:36+00', 'Já mais seguro do que dantes vinha.
');

	VALUES (242, 264, TIMESTAMP WITH TIME ZONE '2019-10-08 17:01:48+00', 'Em Belém o remédio deste dano,
');
	VALUES (242, 248, TIMESTAMP WITH TIME ZONE '2019-10-08 18:21:35+00', 'Cila, que ele ama, desta sendo amado,
');
	VALUES (242, 248, TIMESTAMP WITH TIME ZONE '2019-10-08 21:02:34+00', 'Mas inda vosso Império preminente.
');
	VALUES (242, 248, TIMESTAMP WITH TIME ZONE '2019-10-08 22:16:22+00', 'Os segredos, por alta profecia,
');

	VALUES (243, 275, TIMESTAMP WITH TIME ZONE '2020-10-05 08:09:16+00', 'Que descuido foi este em que viveis?
');
	VALUES (243, 275, TIMESTAMP WITH TIME ZONE '2020-10-05 12:44:10+00', 'Com lhe deixar descansos corruptores.
');

	VALUES (244, 249, TIMESTAMP WITH TIME ZONE '2020-10-11 19:18:59+00', 'Chama-se a pequena ilha Moçambique.
');
	VALUES (244, 249, TIMESTAMP WITH TIME ZONE '2020-10-12 02:54:17+00', 'Que tais ódios terá co a nova gente.
');
	VALUES (244, 249, TIMESTAMP WITH TIME ZONE '2020-10-12 08:24:29+00', 'E tu me esperarás, se Amor te fere:
');

	VALUES (245, 258, TIMESTAMP WITH TIME ZONE '2020-06-28 21:43:34+00', 'Seguir os animais, que não seguiam.
');
	VALUES (245, 250, TIMESTAMP WITH TIME ZONE '2020-06-29 01:35:47+00', 'Que esperais? Porque a pondes em tardança?
');

	VALUES (246, 254, TIMESTAMP WITH TIME ZONE '2020-12-09 04:17:02+00', 'Diante do Sol claro, no Horizonte,
');
	VALUES (246, 254, TIMESTAMP WITH TIME ZONE '2020-12-09 09:22:32+00', 'Este deprava às vezes as ciências,
');

	VALUES (247, 251, TIMESTAMP WITH TIME ZONE '2021-01-12 13:35:57+00', 'Nace por este incógnito Hemispério
');

	VALUES (248, 255, TIMESTAMP WITH TIME ZONE '2021-01-25 23:10:10+00', 'Dos povos de Mombaça pouco humanos.
');
	VALUES (248, 255, TIMESTAMP WITH TIME ZONE '2021-01-26 05:17:55+00', 'Aquelas, que o comércio lhe tomavam,
');
	VALUES (248, 255, TIMESTAMP WITH TIME ZONE '2021-01-26 10:03:09+00', 'Brandindo e volteando arremessões;
');
	VALUES (248, 255, TIMESTAMP WITH TIME ZONE '2021-01-26 17:49:44+00', 'Quando um teu ramo, ó Gama, se exprimenta
');

	VALUES (249, 254, TIMESTAMP WITH TIME ZONE '2020-03-15 08:24:51+00', 'Mais apressado do que fora, vinha.
');

	VALUES (250, 263, TIMESTAMP WITH TIME ZONE '2019-08-08 18:13:55+00', 'Dum Mouro, em Moçambique conhecido
');
	VALUES (250, 254, TIMESTAMP WITH TIME ZONE '2019-08-08 22:06:47+00', 'Que, para se evitar força tamanha,
');
	VALUES (250, 263, TIMESTAMP WITH TIME ZONE '2019-08-08 22:13:41+00', '"Desta sorte o Judaico povo antigo
');

	VALUES (251, 277, TIMESTAMP WITH TIME ZONE '2019-02-04 18:54:36+00', 'Jugo perpétuo, eterno cativeiro,
');

	VALUES (252, 255, TIMESTAMP WITH TIME ZONE '2018-12-02 21:48:15+00', 'Tal dos mancebos há, que se arremessa,
');
	VALUES (252, 255, TIMESTAMP WITH TIME ZONE '2018-12-03 02:24:31+00', 'Vivem só de piráticas rapinas,
');
	VALUES (252, 255, TIMESTAMP WITH TIME ZONE '2018-12-03 06:34:02+00', 'Certificar-te, que este era o segundo
');
	VALUES (252, 272, TIMESTAMP WITH TIME ZONE '2018-12-03 11:52:44+00', 'Porque das Parcas sei, minhas amigas,
');

	VALUES (253, 276, TIMESTAMP WITH TIME ZONE '2021-02-05 13:55:24+00', 'Netuno mora, e moram as jocundas
');

	VALUES (254, 256, TIMESTAMP WITH TIME ZONE '2021-02-07 23:45:58+00', 'Ajuntando outros muitos, que pretende
');
	VALUES (254, 256, TIMESTAMP WITH TIME ZONE '2021-02-08 05:27:54+00', 'De Gerum, de Mazcate e Calaiate;
');
	VALUES (254, 270, TIMESTAMP WITH TIME ZONE '2021-02-08 07:35:20+00', '"Ulisses é o que faz a santa casa
');
	VALUES (254, 270, TIMESTAMP WITH TIME ZONE '2021-02-08 10:53:34+00', 'Onde o violento fogo, com ruido,
');

	VALUES (255, 264, TIMESTAMP WITH TIME ZONE '2019-11-07 18:35:24+00', 'E vê primeiro em cores variadas
');
	VALUES (255, 257, TIMESTAMP WITH TIME ZONE '2019-11-07 23:00:41+00', 'Mas de caminho pouca quantidade.
');
	VALUES (255, 264, TIMESTAMP WITH TIME ZONE '2019-11-08 02:07:55+00', 'Sustentava contra ele Vénus bela,
');

	VALUES (256, 277, TIMESTAMP WITH TIME ZONE '2019-06-12 11:15:04+00', 'Porque Afonso verás, soberbo e ovante,
');
	VALUES (256, 277, TIMESTAMP WITH TIME ZONE '2019-06-12 15:05:07+00', 'Pera teus inimigos confessarem
');

	VALUES (257, 258, TIMESTAMP WITH TIME ZONE '2019-04-10 23:02:46+00', 'Já chegam perto, e não com passos lentos,
');
	VALUES (257, 260, TIMESTAMP WITH TIME ZONE '2019-04-11 06:13:52+00', 'Ouviu-lhe essas palavras piedosas
');
	VALUES (257, 258, TIMESTAMP WITH TIME ZONE '2019-04-11 08:52:13+00', 'Ou parecerão fábulas sonhadas,
');
	VALUES (257, 258, TIMESTAMP WITH TIME ZONE '2019-04-11 10:54:24+00', 'Suspeitas das insídias que ordenava
');

	VALUES (258, 266, TIMESTAMP WITH TIME ZONE '2018-11-09 00:18:39+00', 'Fazer uma famosa expedição
');
	VALUES (258, 266, TIMESTAMP WITH TIME ZONE '2018-11-09 01:17:28+00', 'Pera lhe abalroar as caravelas,
');
	VALUES (258, 259, TIMESTAMP WITH TIME ZONE '2018-11-09 03:54:59+00', 'Ouviu-lhe essas palavras piedosas
');
	VALUES (258, 266, TIMESTAMP WITH TIME ZONE '2018-11-09 07:42:01+00', 'Tal manha buscou já, para que aquele
');

	VALUES (259, 262, TIMESTAMP WITH TIME ZONE '2019-04-18 17:50:52+00', 'Mas pois saber humano nem prudência
');
	VALUES (259, 276, TIMESTAMP WITH TIME ZONE '2019-04-18 21:15:37+00', '"Além disso, o que a tudo enfim me obriga,
');
	VALUES (259, 276, TIMESTAMP WITH TIME ZONE '2019-04-18 23:44:56+00', 'Rezando as mães, irmãs, damas e esposas,
');
	VALUES (259, 262, TIMESTAMP WITH TIME ZONE '2019-04-19 03:53:01+00', 'Destemperada e a voz enrouquecida,
');

	VALUES (260, 266, TIMESTAMP WITH TIME ZONE '2019-02-23 08:23:09+00', 'Varias províncias tem de várias gentes,
');
	VALUES (260, 262, TIMESTAMP WITH TIME ZONE '2019-02-23 10:54:06+00', 'Novo remédio em terra busca e toma:
');

	VALUES (261, 264, TIMESTAMP WITH TIME ZONE '2019-10-13 02:25:25+00', 'Relâmpados que o ar em fogo acendem,
');
	VALUES (261, 277, TIMESTAMP WITH TIME ZONE '2019-10-13 05:06:08+00', 'Que de outra arte pudera ser perdido,
');
	VALUES (261, 277, TIMESTAMP WITH TIME ZONE '2019-10-13 07:13:05+00', '"Outro também dos doze em Alemanha
');
	VALUES (261, 277, TIMESTAMP WITH TIME ZONE '2019-10-13 10:58:52+00', 'Ouvindo as opressões que na passagem
');

	VALUES (262, 265, TIMESTAMP WITH TIME ZONE '2018-11-30 00:46:22+00', 'Faz não sentir que é perda grande e rara,
');
	VALUES (262, 265, TIMESTAMP WITH TIME ZONE '2018-11-30 06:51:55+00', 'Responde ao embaixador, que tanto estima:
');
	VALUES (262, 265, TIMESTAMP WITH TIME ZONE '2018-11-30 14:38:58+00', 'Cobrem ouro e aljôfar ao veludo.
');

	VALUES (263, 280, TIMESTAMP WITH TIME ZONE '2019-05-09 05:49:08+00', 'A terra Oriental que o Indo rega;
');
	VALUES (263, 280, TIMESTAMP WITH TIME ZONE '2019-05-09 10:46:57+00', 'A quem amor não dera um só desgosto,
');

	VALUES (264, 266, TIMESTAMP WITH TIME ZONE '2020-12-19 22:35:25+00', 'Sofrerá suas cidades e lugares,
');
	VALUES (264, 266, TIMESTAMP WITH TIME ZONE '2020-12-20 01:28:45+00', 'Os belicosos ânimos, que inflama:
');

	VALUES (265, 266, TIMESTAMP WITH TIME ZONE '2018-11-10 11:32:05+00', 'Que eu pelo rosto angélico apertava
');
	VALUES (265, 281, TIMESTAMP WITH TIME ZONE '2018-11-10 16:38:18+00', 'Para o avô cruel assim dizia:
');
	VALUES (265, 281, TIMESTAMP WITH TIME ZONE '2018-11-10 18:10:27+00', 'Se tem notícia inteira e certa prova
');
	VALUES (265, 266, TIMESTAMP WITH TIME ZONE '2018-11-10 23:35:14+00', 'Sem irdes a pregar a santa Fé?
');

	VALUES (266, 278, TIMESTAMP WITH TIME ZONE '2018-03-09 00:20:12+00', 'E o ginete belígero arremessa.
');
	VALUES (266, 267, TIMESTAMP WITH TIME ZONE '2018-03-09 04:57:40+00', 'Armas com que Albuquerque irá amansando
');
	VALUES (266, 267, TIMESTAMP WITH TIME ZONE '2018-03-09 11:24:15+00', 'Mas seguindo a vitória estrui e mata;
');
	VALUES (266, 278, TIMESTAMP WITH TIME ZONE '2018-03-09 13:06:15+00', '''Aurea'', por epitéto lhe ajuntaram;
');

	VALUES (267, 270, TIMESTAMP WITH TIME ZONE '2020-03-07 02:42:41+00', 'Via estar todo o Céu determinado
');
	VALUES (267, 270, TIMESTAMP WITH TIME ZONE '2020-03-07 04:54:38+00', '--"Como! Da gente ilustre Portuguesa
');
	VALUES (267, 270, TIMESTAMP WITH TIME ZONE '2020-03-07 09:06:07+00', 'O Império tomaram a Constantino.
');

	VALUES (268, 281, TIMESTAMP WITH TIME ZONE '2020-07-07 19:27:36+00', 'Quase piramidal, que no regaço
');
	VALUES (268, 281, TIMESTAMP WITH TIME ZONE '2020-07-07 20:00:16+00', 'Fazem mil vezes feitos sublimados.
');

	VALUES (269, 280, TIMESTAMP WITH TIME ZONE '2020-03-14 08:45:15+00', 'Em virtude do Rei, da pátria mesta,
');
	VALUES (269, 280, TIMESTAMP WITH TIME ZONE '2020-03-14 10:34:13+00', 'O rosto banha em lágrimas ardentes,
');
	VALUES (269, 280, TIMESTAMP WITH TIME ZONE '2020-03-14 12:23:14+00', 'Se parte o Capitão, para onde peça
');

	VALUES (270, 276, TIMESTAMP WITH TIME ZONE '2020-03-25 09:54:01+00', 'E à sua pátria e Rei temido e amado
');
	VALUES (270, 276, TIMESTAMP WITH TIME ZONE '2020-03-25 15:35:49+00', 'Mas vingo-me: que os bens mal repartidos
');
	VALUES (270, 273, TIMESTAMP WITH TIME ZONE '2020-03-25 23:26:32+00', 'Este corrompe virginais purezas,
');
	VALUES (270, 276, TIMESTAMP WITH TIME ZONE '2020-03-25 23:58:17+00', 'Mas enxerga-se num e noutro bando
');

	VALUES (271, 274, TIMESTAMP WITH TIME ZONE '2020-10-11 13:05:42+00', 'Que foram presos os feitores, quando
');
	VALUES (271, 279, TIMESTAMP WITH TIME ZONE '2020-10-11 15:51:33+00', 'Do torpe Ismaelita cavaleiro,
');
	VALUES (271, 279, TIMESTAMP WITH TIME ZONE '2020-10-11 20:08:41+00', 'De armas, e roupas de uso mais moderno,
');

	VALUES (272, 276, TIMESTAMP WITH TIME ZONE '2018-10-30 04:09:56+00', '"Os Portugueses somos do Ocidente,
');
	VALUES (272, 276, TIMESTAMP WITH TIME ZONE '2018-10-30 05:06:04+00', 'De cavalos, jaezes, presa rica,
');
	VALUES (272, 281, TIMESTAMP WITH TIME ZONE '2018-10-30 11:47:28+00', 'Veloso, sem que alguém lhe ali ajudasse;
');
	VALUES (272, 281, TIMESTAMP WITH TIME ZONE '2018-10-30 18:28:42+00', 'Que tudo o fogo erguido queima e corre:
');

	VALUES (273, 279, TIMESTAMP WITH TIME ZONE '2019-04-24 12:07:36+00', 'Vão a Mênfis e às terras, que se regam
');

	VALUES (274, 278, TIMESTAMP WITH TIME ZONE '2019-02-18 23:03:23+00', 'África esconde em si luzentes veias;
');
	VALUES (274, 277, TIMESTAMP WITH TIME ZONE '2019-02-19 03:00:33+00', 'De iguarias suaves e divinas,
');
